import React, { Component } from 'react';
import beerService from './services/beerService';

class App extends Component {
  render() {
    let beers = [];
    const getBeers = async () => {
      let res = await beerService.getData();
      beers.push(res);
    }
    return <div></div>
  }
}

export default App;
